DROP TABLE IF EXISTS `member_user`;
CREATE TABLE `member_user` (
  `mid` varchar(64) NOT NULL,
  `login_name` varchar(20) NOT NULL,
  `login_secret` int(11) DEFAULT NULL,
  `login_pwd` varchar(50) NOT NULL,
  `pay_pwd` varchar(100) DEFAULT NULL,
  `user_type` varchar(4) DEFAULT '0',
  `user_sex` varchar(4) DEFAULT '0',
  `user_name` varchar(20) DEFAULT NULL,
  `true_name` varchar(100) DEFAULT NULL COMMENT '真实姓名',
  `brithday` date DEFAULT NULL,
  `user_photo` varchar(255) DEFAULT '',
  `user_QQ` varchar(20) DEFAULT NULL,
  `user_phone` varchar(255) DEFAULT NULL,
  `user_email` varchar(50) DEFAULT '',
  `user_money` float(11,2) DEFAULT '0.00' COMMENT '用户钱',
  `user_score` int(11) DEFAULT '0' COMMENT '用户积分',
  `user_total_score` int(11) DEFAULT '0' COMMENT '用户总积分',
  `last_IP` varchar(16) DEFAULT NULL,
  `last_time` datetime DEFAULT NULL,
  `lock_money` decimal(11,2) DEFAULT '0.00' COMMENT '保证金',
  `user_status` char(4) DEFAULT '0' COMMENT '用户状态0表示未激活 1表示激活，2表示停用3，表示禁用 ',
  `del_flag` char(4) DEFAULT '0',
  `level_id` varchar(64) DEFAULT '1' COMMENT '用户级别',
  `parentId` varchar(11) DEFAULT '0' COMMENT '推荐人ID',
  `grandfatherId` varchar(11) DEFAULT NULL COMMENT '爷爷级ID',
  `point` varchar(255) DEFAULT NULL COMMENT '会员所在点位：父节点.位置',
  `direct_path` varchar(255) DEFAULT '0' COMMENT '推荐关系',
  `node_path` varchar(255) DEFAULT '0' COMMENT '节点关系',
  `path` text COMMENT '节点路径‘-1-2-3-’',
  `child_cnt` int(11) DEFAULT '0' COMMENT '节点个数',
  `depth` int(11) NOT NULL DEFAULT '1' COMMENT '节点深度',
  `total_number` int(11) DEFAULT '0' COMMENT '旗下总人数',
  `serial_number` varchar(255) DEFAULT NULL COMMENT '编号',
  `zt_size` int(11) DEFAULT '0' COMMENT '直推数量',
  `recommend_number` varchar(255) DEFAULT NULL COMMENT '推荐人编号',
  `token` varchar(255) DEFAULT NULL,
  `bonus` float DEFAULT '0' COMMENT '奖金',
  `shop_id` varchar(64) DEFAULT '0' COMMENT '店铺ID',
  `position` int(11) DEFAULT '0' COMMENT '位置',
  `zd` varchar(3) DEFAULT '0' COMMENT '终端分布0android1：apple 2其他',
  `lang` varchar(3) DEFAULT '1',
  `create_time` datetime DEFAULT NULL,
  `create_by` varchar(255) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `update_by` varchar(255) DEFAULT NULL,
  `remark` varchar(300) DEFAULT NULL,
  `dept_id` varchar(64) DEFAULT NULL,
  `dept_name` varchar(64) DEFAULT NULL,
  `sort` int(11) DEFAULT NULL,
  `is_authName` char(1) DEFAULT '0' COMMENT '是否实名',
  `is_shoper` char(1) DEFAULT '0' COMMENT '是否是商家',
  `identity` char(1) DEFAULT NULL COMMENT '身份',
  `login_ip` varchar(64) DEFAULT NULL COMMENT '登录IP',
  `login_date` datetime DEFAULT NULL COMMENT '最后登录日期',
  PRIMARY KEY (`mid`),
  KEY `userStatus` (`user_status`,`del_flag`),
  KEY `loginName` (`login_name`),
  KEY `userPhone` (`user_phone`),
  KEY `userEmail` (`user_email`),
  KEY `userType` (`user_type`,`del_flag`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='会员表';

