-- ----------------------------
-- Table structure for sp_orders
-- ----------------------------
DROP TABLE IF EXISTS `sp_orders`;
CREATE TABLE `sp_orders` (
  `mid` varchar(64) NOT NULL,
  `order_no` varchar(20) NOT NULL,
  `shop_id` varchar(64) NOT NULL,
  `member_id` varchar(64) NOT NULL,
  `order_status` varchar(4) NOT NULL DEFAULT '-2',
  `goods_money` decimal(11,2) NOT NULL,
  `deliver_type` varchar(4) NOT NULL DEFAULT '0',
  `deliver_money` decimal(11,2) NOT NULL DEFAULT '0.00',
  `total_money` decimal(11,2) NOT NULL DEFAULT '0.00',
  `real_total_money` decimal(11,2) NOT NULL DEFAULT '0.00',
  `pay_type` varchar(4) NOT NULL DEFAULT '0',
  `pay_from` varchar(20) DEFAULT NULL,
  `is_pay` varchar(4) NOT NULL DEFAULT '0',
  `area_id` varchar(64) NOT NULL,
  `area_id_path` varchar(255) DEFAULT NULL,
  `user_name` varchar(20) NOT NULL,
  `user_address` varchar(255) NOT NULL,
  `user_phone` char(20) DEFAULT NULL,
  `order_score` int(11) NOT NULL DEFAULT '0',
  `is_invoice` varchar(4) NOT NULL DEFAULT '0',
  `invoice_client` varchar(255) DEFAULT NULL,
  `order_remarks` varchar(255) DEFAULT NULL,
  `order_src` varchar(4) NOT NULL DEFAULT '0',
  `need_pay` decimal(11,2) DEFAULT '0.00',
  `pay_rand` int(11) DEFAULT '1',
  `order_type` int(11) DEFAULT '0',
  `is_refund` varchar(4) NOT NULL DEFAULT '0',
  `is_appraise` varchar(4) DEFAULT '0',
  `cancel_reason` int(11) DEFAULT '0',
  `reject_reason` int(11) DEFAULT '0',
  `reject_otherreason` varchar(255) DEFAULT NULL,
  `is_closed` varchar(4) NOT NULL DEFAULT '0',
  `goods_search_keys` text,
  `orderunique` varchar(50) NOT NULL COMMENT '订单流水号',
  `receive_time` datetime DEFAULT NULL COMMENT '收货时间',
  `delivery_time` datetime DEFAULT NULL COMMENT '发货时间',
  `trade_no` varchar(100) DEFAULT NULL COMMENT '在线支付流水',
  `settlement_id` varchar(64) NOT NULL COMMENT '是否结算，大于0的话则是结算ID',
  `commission_fee` decimal(11,2) DEFAULT '0.00' COMMENT '订单佣金',
  `score_money` decimal(11,2) DEFAULT '0.00' COMMENT '积分抵扣的金额',
  `use_score` int(11) DEFAULT '0' COMMENT '积分抵扣的金额',
  `order_code` varchar(20) DEFAULT 'order',
  `extra_json` text,
  `order_code_target_id` varchar(11) DEFAULT '0',
  `notice_deliver` varchar(3) NOT NULL DEFAULT '0' COMMENT '提醒发货 0:未提醒 1:已提醒',
  `invoice_json` text COMMENT '发票信息',
  `lock_cash_money` decimal(11,2) DEFAULT '0.00' COMMENT '锁定提现金额',
  `pay_time` datetime DEFAULT NULL,
  `is_batch` varchar(4) DEFAULT '0',
  `total_pay_fee` decimal(11,0) DEFAULT '0',
  `is_make_invoice` varchar(4) DEFAULT '0' COMMENT '是否开发票 1:是 0:否',
  `after_sale_end_time` datetime DEFAULT NULL COMMENT '售后结束时间,确认收货时间+后台设置的售后有效天数',
  `get_score_val` decimal(11,2) DEFAULT '0.00' COMMENT '获得的积分数可抵扣的金额',
  `refunded_pay_money` decimal(11,2) DEFAULT '0.00' COMMENT '已退款支付金额',
  `refunded_score` int(10) DEFAULT '0' COMMENT '已退款积分',
  `refunded_score_money` decimal(11,2) DEFAULT '0.00' COMMENT '已退款积分抵扣金额',
  `refunded_getscore` int(10) DEFAULT '0' COMMENT '已退款 购买商品获得的积分(用户本身购买商品可获得的积分),即失效的获得积分数',
  `refunded_get_score_money` decimal(11,2) DEFAULT '0.00' COMMENT '已退款 购买商品获得的积分可抵扣的金额',
  `del_flag` char(1) DEFAULT '0',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '跟新人',
  `update_time` datetime DEFAULT NULL COMMENT '跟新时间',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `dept_id` varchar(64) DEFAULT NULL,
  `dept_name` varchar(64) DEFAULT NULL,
  `sort` int(11) DEFAULT NULL COMMENT '分类id',
  PRIMARY KEY (`mid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='订单';

