  `use_score_money` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '使用的积分可抵扣金额',
  `get_score_money` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '获得的积分可抵扣金额',
  `refund_money` decimal(11,2) DEFAULT NULL COMMENT '申请退款的金额',
  `refundable_money` decimal(11,2) DEFAULT NULL COMMENT '售后单可退款金额',
  `is_shop_agree` varchar(4) DEFAULT '0' COMMENT '1:同意 0：不同意',
  `disagree_remark` varchar(600) DEFAULT NULL COMMENT '商家不同意原因',
  `user_address_id` varchar(64) NOT NULL COMMENT '用户收货地址id',
  `area_id` varchar(64) NOT NULL COMMENT '地区id',
  `area_id_path` varchar(255) DEFAULT NULL COMMENT '地区id值',
  `user_name` varchar(200) DEFAULT '' COMMENT '用户收货人',
  `user_address` varchar(200) DEFAULT '' COMMENT '用户详细收货地址',
  `user_phone` varchar(200) DEFAULT '' COMMENT '用户收货电话',
  `shop_area_id` varchar(64) NOT NULL COMMENT '商家收货地区id',
  `shop_area_id_path` varchar(255) DEFAULT NULL COMMENT '商家收货地区id值',
  `shop_name` varchar(200) DEFAULT '' COMMENT '商家收货人',
  `shop_address` varchar(200) DEFAULT '' COMMENT '商家详细收货地址',
  `shop_phone` varchar(200) DEFAULT '' COMMENT '商家收货电话',
  `is_user_send_goods` varchar(4) DEFAULT '0' COMMENT '0：未发货 1：已发货',
  `express_type` varchar(4) DEFAULT '0' COMMENT '0：无需物流  1：快递',
  `express_id` varchar(64) NOT NULL COMMENT '买家快递id',
  `express_no` varchar(200) DEFAULT '' COMMENT '买家物流单号',
  `is_shop_accept` varchar(4) DEFAULT '0' COMMENT '商家是否收到货 -1：拒收  0：未收货  1：已收货',
  `shop_reject_type` int(10) NOT NULL DEFAULT '0' COMMENT '商家拒收类型,数据由基础数据类型里取',
  `shop_reject_other` varchar(600) DEFAULT NULL COMMENT '商家拒收原因,选择“其他”的时候填写文字',
  `shop_reject_img` varchar(150) DEFAULT NULL COMMENT '拒收时的货物图片',
  `is_shop_send` varchar(4) NOT NULL DEFAULT '0' COMMENT '商家是否发货 0：未发货 1：已发货',
  `shop_express_type` varchar(4) DEFAULT '0' COMMENT '0：无需物流  1：快递',
  `shop_express_id` varchar(64) NOT NULL COMMENT '商家快递id',
  `shop_express_no` varchar(200) DEFAULT '' COMMENT '商家快递单号',
  `is_user_accept` varchar(4) NOT NULL DEFAULT '0' COMMENT '-1：拒收 0：未收货  1：已收货',
  `user_reject_type` varchar(4) NOT NULL DEFAULT '0' COMMENT '用户拒收原因,数据由基础数据类型里取',
  `user_reject_other` varchar(600) DEFAULT NULL COMMENT '用户拒收原因,选择“其他”的时候填写文字',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `is_close` varchar(4) NOT NULL DEFAULT '0' COMMENT '是否结束 0：进行中  1:已结束',
  `service_status` varchar(4) NOT NULL DEFAULT '0' COMMENT '状态备注：0：待商家审核  1：等待用户发货 2：商家等待收货 3：商家确认收货  4：等待商家发货  5：确认收货  6：完成退款/退货',
  `shop_accept_expire_time` datetime DEFAULT NULL COMMENT '商家受理期限',
  `user_send_expire_time` datetime DEFAULT NULL COMMENT '用户发货期限',
  `shop_receive_expire_time` datetime DEFAULT NULL COMMENT '商家收货期限',
  `get_score_val` int(10) NOT NULL DEFAULT '0' COMMENT '本次申请的商品,购买时获得的积分数',
  `del_flag` char(1) DEFAULT '0',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建人',
  `update_by` varchar(64) DEFAULT NULL COMMENT '跟新人',
  `update_time` datetime DEFAULT NULL COMMENT '跟新时间',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `dept_id` varchar(64) DEFAULT NULL,
  `dept_name` varchar(64) DEFAULT NULL,
  `sort` int(11) DEFAULT NULL COMMENT '分类id',
  PRIMARY KEY (`mid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='订单服务';

