-- ----------------------------
-- Table structure for sys_dept
-- ----------------------------
DROP TABLE IF EXISTS `sys_dept`;
CREATE TABLE `sys_dept` (
  `id` varchar(64) NOT NULL COMMENT '表主键',
  `number` varchar(64) DEFAULT NULL COMMENT '编号',
  `name` varchar(255) NOT NULL COMMENT '机构名称',
  `type` int(11) DEFAULT NULL COMMENT '机构类型：1：铁道部  2：集团   3：局  4：分局  5：段  6：车间  7：工区',
  `org_type_flag` int(11) DEFAULT '1' COMMENT '机构类型标志（枚举）  1 行政机构，2 生产机构 3部门',
  `man_pro_type` int(11) DEFAULT '0',
  `parent_id` varchar(64) NOT NULL,
  `parent_org_type_flag` int(64) DEFAULT '1',
  `classid` varchar(64) DEFAULT '1' COMMENT '生产机构分类：现场车间，电子车间等，与系统字典表相关',
  `desc` varchar(4000) DEFAULT NULL COMMENT '机构描述信息',
  `flag_leaf` varchar(64) DEFAULT '0' COMMENT '树的叶子节点标记，辅助编程。末级单位标志*，铁道部进行组织机构维护时自动算出，表明是行政机构的最后一级单位，如果出现有的有分局，有的没分局，这时该标志对编程人员来讲非常有用，省去很多麻烦。',
  `level` int(11) DEFAULT '1' COMMENT '机构的级别 1：部  2：局   3：段  4： 车间  5： 工区',
  `org_level` int(11) DEFAULT '1' COMMENT '集团-1;集团领导-2;处室-3;处领导-4;处科室-5;段-6;段领导-7;段科室-8;车间-9;工区-10',
  `phone` varchar(64) DEFAULT NULL COMMENT '值班电话',
  `nid` varchar(64) DEFAULT NULL COMMENT '数字短串ID，用于考勤机',
  `dep_class` int(11) DEFAULT '1' COMMENT '部门分类：0 业务科室  1 行政科室',
  `sort` int(11) DEFAULT NULL COMMENT '排序号',
  `del_flag` char(1) DEFAULT '0' COMMENT '删除标志（0代表存在 2代表删除）',
  `create_by` varchar(64) DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  `status` char(1) DEFAULT '0' COMMENT '部门状态',
  `ancestors` varchar(600) DEFAULT NULL COMMENT '子部门',
  `short_name` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='组织机构';

-- ----------------------------
-- Records of sys_dept
-- ----------------------------

