DROP TABLE IF EXISTS `sys_station`;
CREATE TABLE `sys_station` (
  `id` varchar(64) NOT NULL,
  `line_id` varchar(64) DEFAULT NULL COMMENT '一级归属线别主键',
  `station_number` varchar(64) DEFAULT NULL COMMENT '车站略号',
  `name` varchar(255) DEFAULT NULL COMMENT '车站名称',
  `name_py` varchar(255) DEFAULT NULL,
  `short_name` varchar(255) DEFAULT NULL,
  `build` varchar(64) DEFAULT NULL COMMENT '建设年',
  `repair_heavy` varchar(64) DEFAULT NULL COMMENT '大修年',
  `repair_middle` varchar(64) DEFAULT NULL COMMENT '中修年',
  `replace` varchar(255) DEFAULT NULL COMMENT '更新改造年',
  `station_class` varchar(64) DEFAULT NULL COMMENT '车站类别(字典)区段站、中间站、其它',
  `interlock_type` varchar(64) DEFAULT NULL COMMENT '联锁类型(字典)',
  `interlock_work` varchar(64) DEFAULT NULL COMMENT '计算机联锁厂家(字典)',
  `computer_type` varchar(64) DEFAULT NULL COMMENT '计算机联锁类型(字典)',
  `block_mode` varchar(64) DEFAULT NULL COMMENT '闭塞方式(字典)',
  `trackcuit_type` varchar(64) DEFAULT NULL COMMENT '轨道电路类型(字典)',
  `code_mode` varchar(64) DEFAULT NULL COMMENT '电码化方式(字典)',
  `code_type` varchar(255) DEFAULT NULL COMMENT '电码化类型(字典)',
  `right_rail_type` varchar(255) DEFAULT NULL COMMENT '正线钢轨类型(字典) 75KG、60KG、50KG、43KG、40KG、其他',
  `side_rail_type` varchar(255) DEFAULT NULL COMMENT '侧线钢轨类型(字典)',
  `if_eds` varchar(255) DEFAULT NULL COMMENT '是否安装微机检测',
  `sup_mode` varchar(255) DEFAULT NULL COMMENT '监控方式(字典)',
  `switch_for_equ` int(11) DEFAULT NULL COMMENT '设备换算道岔数',
  `block_type` varchar(255) DEFAULT NULL COMMENT '智能电源屏含5KVAUPS设备(字典)',
  `power_type` varchar(255) DEFAULT NULL COMMENT '电源屏类型',
  `power_work` varchar(255) DEFAULT NULL COMMENT '电源屏厂家',
  `power_equ` varchar(255) DEFAULT NULL COMMENT '智能电源屏含5KVA UPS设备',
  `flag` int(11) DEFAULT NULL COMMENT '车站类型:1-大站 其它-小站',
  `type` int(11) DEFAULT NULL COMMENT '1是车站，2是驼峰，3是道口，4是区间',
  `kmmark` int(11) DEFAULT NULL COMMENT '公里标',
  `phone` varchar(255) DEFAULT NULL,
  `updown` int(11) DEFAULT '0' COMMENT '上下行类型  0:上行,1:下行,2:上下行',
  `sort` int(11) DEFAULT NULL COMMENT '排序用的序号',
  `create_by` varchar(64) DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  `dept_id` varchar(64) DEFAULT NULL,
  `dept_name` varchar(64) DEFAULT NULL,
  `cj_id` varchar(64) DEFAULT NULL,
  `cj_name` varchar(64) DEFAULT NULL,
  `gq_id` varchar(64) DEFAULT NULL,
  `gq_name` varchar(64) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='站表';

