DROP TABLE IF EXISTS `sys_user`;
CREATE TABLE `sys_user` (
  `id` varchar(50) NOT NULL DEFAULT '' COMMENT '主键',
  `number` varchar(20) DEFAULT '' COMMENT '人员工作证号',
  `dept_id` varchar(50) DEFAULT NULL COMMENT '所属机构主键',
  `log_name` varchar(500) NOT NULL COMMENT '登陆别名，初始时和用户名默认一致',
  `name` varchar(500) DEFAULT NULL COMMENT '真实姓名',
  `name_py` varchar(50) DEFAULT NULL COMMENT '姓名拼音',
  `pid` varchar(500) DEFAULT NULL COMMENT '身份证号码',
  `pwd` varchar(500) NOT NULL COMMENT '登陆密码',
  `sex` int(11) DEFAULT '0' COMMENT '性别 缺省为 0-男 1-女',
  `born` datetime DEFAULT NULL COMMENT '出生年月',
  `title` varchar(500) DEFAULT NULL COMMENT '职称或技术等级，来自字典表',
  `position` varchar(500) DEFAULT NULL COMMENT '职务或职名，来自字典表',
  `tel` varchar(500) DEFAULT NULL COMMENT '办公电话',
  `mobile` varchar(500) DEFAULT '' COMMENT '手机',
  `phone` varchar(500) DEFAULT '' COMMENT '家庭电话',
  `flow_id` int(11) DEFAULT NULL COMMENT '工作流中用到用户角色id',
  `mail_name` varchar(50) DEFAULT NULL COMMENT 'EMAIL',
  `worktype` varchar(500) DEFAULT '' COMMENT '工种：和字典表关联',
  `home` varchar(500) DEFAULT '' COMMENT '籍贯',
  `address` varchar(500) DEFAULT '' COMMENT '家庭住址',
  `politics` varchar(50) DEFAULT NULL COMMENT '政治面貌，来自字典表',
  `join_date` datetime DEFAULT NULL COMMENT '入路时间（参加工作时间）',
  `grade` varchar(50) DEFAULT '' COMMENT '文化程度，来自字典表',
  `crtr` varchar(50) DEFAULT '' COMMENT '最后编辑人',
  `crtrdate` datetime DEFAULT NULL COMMENT '记录日期，输入录入日期或者最后一次编辑或删除的日期',
  `chief_type` varchar(50) DEFAULT '' COMMENT '人员等级（用于区分普通职工，一般干部，主管领导等），来自字典表',
  `last_number` varchar(50) DEFAULT '' COMMENT '用户最近一次使用的子系统编号',
  `photo_id` varchar(50) DEFAULT NULL COMMENT '照片id',
  `desc` varchar(4000) DEFAULT '' COMMENT '岗位工作标准',
  `fileid` varchar(4000) DEFAULT NULL COMMENT '廉政承诺书',
  `mobile_account` int(11) DEFAULT '0' COMMENT '是否为手机登陆用户，默认0 非手机登陆用户，1为手机用户',
  `imei` varchar(50) DEFAULT NULL COMMENT '手机串号',
  `status` int(11) DEFAULT NULL COMMENT '用户状态： 0-非系统用户 1-系统用户  9-超级管理员',
  `sort` int(11) DEFAULT NULL COMMENT '系统排序号',
  `del_flag` int(11) DEFAULT '0' COMMENT '删除标志位',
  `create_by` varchar(64) DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  `email` varchar(255) DEFAULT NULL COMMENT '邮箱',
  `login_ip` varchar(50) DEFAULT NULL,
  `login_date` datetime DEFAULT NULL,
  `avatar` varchar(100) DEFAULT NULL,
  `real_name` varchar(60) DEFAULT NULL,
  `is_staff` int(3) DEFAULT '1' COMMENT '是否职员',
  `is_account` int(3) DEFAULT '1' COMMENT '是否账号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='人员表';

